import { FormGroup, MenuItem, TextField, Typography } from '@material-ui/core'
import React from 'react'
import { types } from '../assets/types'

export function Listbulletinboard() {
  return (
    <>
      <FormGroup row sx={{ m: 5 }}>
        <Typography variant='h2' component='h2'>
          Endomarketing
        </Typography>
        {types && (
          <TextField
            variant='outlined'
            select
            size='small'
            label='Tipo'
            sx={{ width: 200, mt: 3, ml: 2 }}
          >
            {types.map((e, i) => (
              <MenuItem value={e.value} key={i}>
                {e.label}
              </MenuItem>
            ))}
          </TextField>
        )}
      </FormGroup>
    </>
  )
}
